description:
A new Action Move by Francesco Fanelli full of twists and beautiful women. An international cast that involves among others Doll, Big Willy and black mark in a plot between the police mafia Italian and Chinese. Despite an exemplary career even the best agents are fascinated by the easy money and when it comes to getting your hands on a suitcase priceless ... All that money that ripagherebbero the labors of a life of risk and no recognition, but ...

